                                value={""}
                              //  onChange={handleChange('name')}
                                margin="normal"
                            />
                        </div>
                        <div className="flex pa2">
                        <TextField
                                id="standard-name"
                                label="EMAIL ADDRESS"
                                placeholder="Email"
                               className={classes.textField}
                                value={""}
                              //  onChange={handleChange('name')}
                                margin="normal"
                            />
                        </div>
                        </div>
                        <div className="flex flex-row w-100 b">
                            <div className="flex pa2">
                        <TextField
                                id="standard-name"
                                label="EXPERIENCE"
                               className={classes.textField}
                                value={""}
                              //  onChange={handleChange('name')}
                                margin="normal"
                            />
                        </div>
                        <div className="flex pa2">
                        <TextField
                                id="standard-name"
                                label="Name"
                               className={classes.textField}
                                value={""}
                              //  onChange={handleChange('name')}
                                margin="normal"
                            />
                        </div>
                        </div>

                        </div>
                    </div>
                </div>
                <div className="flex flex-row items-center">
                    <div className="flex white-60 justify-center w-60 pa3 ma3">2017.Company.Lorem ipsum dolor sit amet,consectetur adipiscing slit</div>
                    <div className="flex wite-60 justify-center w-40 pa3 ma3"><img src={a} width={250} height={50}/></div>
                </div>
            </div>
        )
    }
}

export default withStyles(styles, { withTheme: true })(FeedbackForm)
